Jeffrey A. Stock, Michael P. Esposito, Vincent Lanteri &quot;Urologic Robotic Surgery&quot;
Humana Press | 2008-03-01 | ISBN: 1588296156 | 240 pages | PDF 


The introduction of robotic technology into modern day operating theatres has changed the way that surgery will be preformed. The last five years have shown a paradigm shift toward the adoption of robotic surgical techniques by private and academic institutions alike.

This transition has been driven by an increasingly educated patient population who seek out less morbid ways to address their disease. The introduction of this new technology has allowed for a significant advancement in patient care. By providing a minimally invasive surgical option, patient recovery is faster with comparable outcomes to open surgical techniques.
